import React from "react";
import '../static/css/Navbar.css';
import '../static/css/Main.css';
import Navbar from './Navbar';

class First extends Component {

  render(){
    return(
      <div>
        <Navbar />
        <div className='main'>
          <h1 className='fade_in'>Rafael Wanner</h1>
          <p>Personal site</p>
        </div>
      </div>
    );
  }
}

export default First;
